  `configuration_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `key` varchar(128) NOT NULL COMMENT '配置标志',
  `value` longtext NOT NULL COMMENT '配置值',
  `description` varchar(200) NOT NULL DEFAULT '' COMMENT '配置描述说明',
  `sort` smallint(4) NOT NULL DEFAULT '0',
  `group` varchar(32) NOT NULL DEFAULT '' COMMENT '配置组',
  `show_type` varchar(32) NOT NULL DEFAULT '' COMMENT '配置展示类型',
  `gmt_create` datetime NOT NULL,
  `gmt_modify` datetime NOT NULL,
  `operator` varchar(32) NOT NULL,
  PRIMARY KEY (`configuration_id`),
  UNIQUE KEY `idx_key` (`key`),
  KEY `idx_group` (`group`),
  KEY `idx_sort` (`sort`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='网站配置';

