/*Table structure for table `kb_order_collection` */

DROP TABLE IF EXISTS `kb_order_collection`;

CREATE TABLE `kb_order_collection` (
  `order_collection_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `order_number` varchar(32) NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '订单状态，1待处理，2处理中，3已处理，4已取消',
  `shop_name` varchar(128) NOT NULL,
  `shop_keywords` varchar(256) NOT NULL,
  `shop_url` varchar(1000) NOT NULL,
  `shop_product_id` varchar(64) NOT NULL,
  `title` varchar(200) NOT NULL,
  `title_id` int(11) NOT NULL,
  `cost_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `general_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `vip_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `agent_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `api_price` decimal(8,2) NOT NULL DEFAULT '0.00',
  `buy_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '会员购买价格',
  `post_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '提交总站的实际支付价格',
  `gmt_post` datetime DEFAULT NULL,
  `gmt_create` datetime NOT NULL,
  `gmt_modify` datetime NOT NULL,
  `operator` varchar(32) NOT NULL DEFAULT '',
  PRIMARY KEY (`order_collection_id`),
  KEY `idx_user_id` (`user_id`),
  KEY `idx_status` (`status`),
  KEY `idx_title_id` (`title_id`)
