/*Table structure for table `kb_province` */

DROP TABLE IF EXISTS `kb_province`;

CREATE TABLE `kb_province` (
  `province_id` int(11) NOT NULL AUTO_INCREMENT,
  `province_name` varchar(64) NOT NULL COMMENT '省份名称',
  `province_areacode` int(11) NOT NULL COMMENT '省份区域代码',
  `province_postcode` varchar(6) NOT NULL COMMENT '省份邮编',
